import React from 'react';

const foodsILike = [
  {
    id: 1,
    name: "pizza",
    image: "https://post-phinf.pstatic.net/MjAxOTExMDlfMjE0/MDAxNTczMjQ3Njc2MDg0.PUMbHI9NjeHRL-34UuU153PhzzTVStUhbyK8wvjrN3Eg.YZO1VkdwTQdtx3BxNJNopHlqjibUBFxZRxJI6M4gtaAg.JPEG/pizza.jpg?type=w1200",
    rating: 5
  },
  {
    id: 2,
    name: "hamberger",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSPl5CjiIZ3xGOxuc3JAtYqFo4c-zZewNlldQ&usqp=CAU",
    rating: 4.9
  },
  {
    id: 3,
    name: "chicken",
    image: "https://lh3.googleusercontent.com/proxy/D6O_kfkboIBi-LwfXZoBicANm8I2StvBqQySwuN_0TYsKks_azaB_0YImA9_kZavu1PsuEGoE6IwuIV_9iNMS2rpEo4ckba7jDXwmOKGtP0pqdkcSLhtxh4hoE60FtwI",
    rating: 4.8
  },
  {
    id: 4,
    name: "sushi",
    image: "https://img.seoul.co.kr/img/upload/2016/02/19/SSI_20160219174306.jpg",
    rating: 5.5
  },
  {
    id: 5,
    name: "taco",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSOtLkf0I4zMxfRfaFhRdvERw5KTdxsN6sT-g&usqp=CAU",
    rating: 4.7
  }
]

function Food({ name, picture }) {
  return (
    <div>
      <h2>I like {name}</h2>
      <img src={picture} alt={name} />
    </div>
  )
}

function App() {
  return (
    <div>
      {foodsILike.map(food => ( 
          <Food key={food.id} name={food.name} picture={food.image} /> 
      ))}
    </div>
  );
}

export default App;
